import React from 'react';
import './أثقخ.css';

const Home = () => {
  return (
    <section id="home" className="home-section">
      <div className="home-container">
        <h1 className="home-title">Hi, I'm <span className="highlight">Frontend Developer</span></h1>
        <p className="home-subtitle">I build modern and responsive web interfaces using React.js</p>
        <a href="#contact" className="home-button">Let's Connect</a>
      </div>
    </section>
  );
};

export default Home;
